script: |
  super -f text -I q1616.spq | sort > q1616.out

inputs:
  - name: q1616.spq
    data: |
      SELECT col2 FROM tab2 (FORMAT parquet) AS cor0 WHERE - 16 NOT BETWEEN ( + + col1 * - ( col2 ) * + 84 ) AND - col0;
  - name: tab2

outputs:
  - name: q1616.out
    data: |
      23
      40
      58
